(*EWcorrection*)
EWParmeter[mzV_,mwV_,mhV_,mtV_,mbV_,SacleMuV_,GFV_]:={mz->mzV,mw->mwV,mh->mhV,mt->mtV,mb->mbV,ScaleMu->SacleMuV,GF->GFV};
(* for EW corrections always take b quark as massive *)
CalEW[mzV_,mwV_,mhV_,mtV_,mbV_,SacleMuV_,GFV_]:=CalEW[EWParmeter[mzV,mwV,mhV,mtV,mbV,SacleMuV,GFV]];
(*NumInput={mz->91.1876,mw->80.377,mh->125,mt->172.69,mb->4.78,ScaleMu->91.1876,GF->1.16638*10^(-5)};*)
Epsilon=1;
CalEW[xx_]:=Module[{NumInput,\[Alpha]rep,\[CapitalDelta]r,vertex1,f1,w1,b1,\[Delta]EW\[Alpha],\[Delta]EWGF,ratio,\[CapitalGamma]0GF,\[Delta]\[CapitalGamma]EWGF},
LightFermionsRep=Rationalize[{me->0.511/1000,m\[Mu]->105.66/1000,m\[Tau]->1784/1000,mu->0.041,md->0.041,mc->1.5,ms->0.15},10^(-30)];
NumInput=Rationalize[xx,10^(-30)];
\[Alpha]rep={\[Alpha]->-((Sqrt[2] GF mw^2 (mw^2-mz^2))/(mz^2 \[Pi]))}/.NumInput;
NumInput=Union[NumInput,\[Alpha]rep,LightFermionsRep];
\[CapitalDelta]r=(Block[{$MaxExtraPrecision=1000},N[EWdeltar/.NumInput,50]]//Re);
vertex1=EWvertexCor/.NumInput;
