\[Delta]EW\[Alpha]=Block[{$MaxExtraPrecision=1000},N[Expand[vertex1+f1+w1+b1],50]//Re];
\[Delta]EWGF=\[Delta]EW\[Alpha]-\[CapitalDelta]r;
ratio=(mt^6-3 mt^2 mw^4+2 mw^6)/(Sqrt[(mt^2-(mb-mw)^2) (mt^2-(mb+mw)^2)] (mb^4+mt^4+mt^2 mw^2-2 mw^4+mb^2 (-2 mt^2+mw^2)))/.NumInput;
\[CapitalGamma]0GF=(GF (mt^6-3 mt^2 mw^4+2 mw^6))/(8 Sqrt[2] mt^3 \[Pi])/.NumInput;
\[Delta]\[CapitalGamma]EWGF=(GF (mt^6-3 mt^2 mw^4+2 mw^6))/(8 Sqrt[2] mt^3 \[Pi])*(\[Delta]EWGF/ratio)/.NumInput;
Block[{$MaxExtraPrecision=1000},N[{\[CapitalGamma]0GF,\[Delta]\[CapitalGamma]EWGF},20]]];

